function getColorNBI(PorceNBI) {
   
        {
            if (PorceNBI >= 0 && PorceNBI <= 11.8) return "#feebe2";
            if (PorceNBI > 11.9 && PorceNBI <= 17.7) return "#fbb4b9";
            if (PorceNBI > 17.8 && PorceNBI <= 24.4) return "#f768a1";
            if (PorceNBI > 24.5 && PorceNBI <= 41.5) return "#c51b8a";
            if (PorceNBI > 41.6 && PorceNBI <= 68.2) return "#b61686";
            if (PorceNBI > 68.9) return "#7a0177";
                   }
};

function styleNBI(feature) {
    return {
        fillColor: getColorNBI(feature.properties.PorceNBI),
        weight: 1,
        opacity: 0.9,
        color: '#292828',
        dashArray: '0',
        fillOpacity: 0.9,
        stroke: '#232323',
    }
}

// Funcin para generar la leyenda
function createLegendNBI() {
    var legend = L.control({ position: 'bottomright' });

    legend.onAdd = function () {
        var div = L.DomUtil.create('div', 'info legend');
        var labels = [];

        var styles = [
            { label: '% Hogares con NBI', color: '' },
            { label: '0 - 11.9', color: '#feebe2' },
            { label: '12.0 - 17.9', color: '#fbb4b9' },
            { label: '18.0 - 24.9', color: '#f768a1' },
            { label: '25.0 - 41.9', color: '#c51b8a' },
            { label: '42.0 - 68.9', color: '#b61686' },
            { label: '> 69', color: '#7a0177' },

            // Agrega aqu el resto de estilos con su respectiva etiqueta y color
        ];

        // Genera el contenido HTML de la leyenda
        styles.forEach(function (style) {
            labels.push(
                '<i style="background:' + style.color + '"></i> ' + style.label
            );
        });

        div.innerHTML = labels.join('<br>');
        return div;
    };

    // Funcin para mostrar/ocultar la leyenda
    function toggleLegend() {
        if (map.hasLayer(NBI)) {
            legend.addTo(map);
        } else {
            legend.remove();
        }
    }
// Eliminar la leyenda al inicio
legend.remove();
    // Escucha el cambio de estado de la capa
    map.on('overlayadd overlayremove', toggleLegend);
}